.segment	"CODE"

;
; if (cx1 > 15) cx1 = cx2;
;
	lda     _cx1
	cmp     #$10
	bcc     L5A80
	lda     _cx2
	sta     _cx1
;
; if (cx2 > 15) cx2 = cx2;
;
L5A80:	lda     _cx2
	cmp     #$10
	bcc     L5A81
	sta     _cx2
;
; cyaux = (cy1 < 2 ? 0 : cy1 - 2) << 4; 
;
L5A81:	lda     _cy1
	cmp     #$02
	bcs     L5A82
	lda     #$00
	jmp     L005B
L5A82:	lda     _cy1
	sec
	sbc     #$02
L005B:	asl     a
	asl     a
	asl     a
	asl     a
	sta     _cyaux
;
; at1 = behs [*(scr_buffer_ptr + cyaux + cx1)];
;
	lda     _scr_buffer_ptr
	ldx     _scr_buffer_ptr+1
	clc
	adc     _cyaux
	bcc     L5A7C
	inx
L5A7C:	ldy     _cx1
	sta     ptr1
	stx     ptr1+1
	lda     (ptr1),y
	sta     ptr1
	lda     #$00
	clc
	adc     #>(_behs)
	sta     ptr1+1
